import 'bulma/css/bulma.css';
import ProfileCard from './ProfileCard';
import AlexaImage from './images/alexa.png';
import SiriImage from './images/siri.png';
import CortanaImage from './images/cortana.png';
function App(){
    return (
        <div>
            <div>Personal Digital Assistants</div>
            <div className="columns">
                <div className="column">
                    <div className="columnm is-4">
                        <ProfileCard title="siri" handle="siri99" image={SiriImage}/>
                    </div>
                </div>
                <div className="column">
                    <div className="columnm is-6">
                        <ProfileCard title="cortana" handle="cortana11" image={CortanaImage}/>
                    </div>
                </div>
                <div className="column">
                    <div className="columnm is-4">
                        <ProfileCard title="alexa" handle="alexa32" image={AlexaImage}/>
                    </div>
                </div>
            </div>
        </div>
    );
}
export default App;
